pragma solidity 0.6.12;

contract MyContract {
    address[] private addressOfBountyMembers;
    mapping(address => mapping(bytes32 => uint256)) public orders;
    mapping(address => mapping(bytes32 => uint256)) public orderfills;
    mapping(address => mapping(address => uint256)) public balanceof;
    address public admin;
    address public feeaccount;
    address public accountlevelsaddr;
    uint256 public feemake;
    uint256 public feetake;
    uint256 public feerebate;

    function order(address _arg1, uint256 _arg2, address _arg3, uint256 _arg4, uint256 _arg5, uint256 _arg6) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), _arg1, _arg2, _arg3 * 0x1000000000000000000000000, _arg4, _arg5, _arg6));
        orders[msg.sender][v0] = 1;
    }

    function cancelOrder(address _arg1, uint256 _arg2, address _arg3, uint256 _arg4, uint256 _arg5, uint256 _arg6, uint8 _arg7, bytes32 _arg8, bytes32 _arg9) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), _arg1, _arg2, _arg3 * 0x1000000000000000000000000, _arg4, _arg5, _arg6));
        if (orders[msg.sender][v0] != 0) {
            orderfills[msg.sender][v0] = _arg2;
        } else {
            address v1 = ecrecover(keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32",v0)), _arg7, _arg8, _arg9);
            orderfills[msg.sender][v0] = _arg2;
        }
    }

    function changeFeeMake(uint256 _arg1) public {
        require(msg.sender == admin, "Only admin can change the fee make");
        feemake = _arg1;
    }

    function withdraw(uint256 _arg1) public {
        require(_arg1 <= balanceof[address(this)][msg.sender], "Withdrawing more than you have");
        balanceof[address(this)][msg.sender] -= _arg1;
        msg.sender.transfer(_arg1);
    }

    function changeFeeRebate(uint256 _arg1) public {
        require(_arg1 <= feetake, "Rebate cannot be more than feetake");
        feerebate = _arg1;
    }

    function changeFeeAccount(address _arg1) public {
        require(msg.sender == admin, "Only admin can change the fee account");
        feeaccount = _arg1;
    }

    function changeFeeTake(uint256 _arg1) public {
        require(msg.sender == admin, "Only admin can change the fee take");
        feetake = _arg1;
    }

    function changeAdmin(address _arg1) public {
        require(msg.sender == admin, "Only admin can change the admin");
        admin = _arg1;
    }

    function depositToken(address _arg1, uint256 _arg2) public {
        require(_arg1 != address(0), "Token address cannot be 0");
        require(_arg2 > 0, "Deposit amount must be greater than 0");
        balanceof[_arg1][msg.sender] += _arg2;
    }

    function changeAccountLevelsAddr(address _arg1) public {
        require(msg.sender == admin, "Only admin can change the account levels address");
        accountlevelsaddr = _arg1;
    }

    function deposit() public payable {
        require(msg.value > 0, "Deposit value must be greater than 0");
        balanceof[address(this)][msg.sender] += msg.value;
    }

    function withdrawToken(address _arg1, uint256 _arg2) public {
        require(_arg1 != address(0), "Token address cannot be 0");
        require(_arg2 <= balanceof[_arg1][msg.sender], "Withdrawing more than you have");
        balanceof[_arg1][msg.sender] -= _arg2;
        msg.sender.transfer(_arg2);
    }
}
